import React from 'react';
import { NavLink } from 'react-router-dom';
const Naviger = () => {
    return (
        <div>
            <NavLink to='/'> <button type="button" class="btn btn-primary"> Accueil</button> </NavLink>
            <NavLink to='/create'><button type="button" class="btn btn-primary">Create</button></NavLink>
            <NavLink to='/update'><button type="button" class="btn btn-primary"> Update</button></NavLink>
            <NavLink to='/delete'><button type="button" class="btn btn-primary"> Delete</button></NavLink>


        </div>
    );
};

export default Naviger;
